import React from 'react'
import axios from 'axios'

class Itunes extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            data: {}
        }
    }
    fetchData = async () => {
        await axios.get(`https://itunes.apple.com/search?term=maroon 5&term=maps`)
        .then(res => {
            this.setState({
                data: res.data,
            })
        })
        .catch(error => {
            console.log(error)
        })
    }
    componentDidMount() {
        this.fetchData()
    }

    render() {
        const { data } = this.state
